function LoadImagesAndRender() {
    var loadedImages = 0;
    for(var i = 0; i < images.length; i++) {
        var source = images[i];
        images[i] = new Image();
        images[i].src = source;
        images[i].onload = function() {
            loadedImages++;
            if (loadedImages == images.length) {
                Render();
            }
        };
    }
}

function Render() {
    let a = document.getElementById('5cbca45942764c48b4d4b152f5a27de9');
    let b = a.getContext('2d');
    a.width = 571;
    a.height = 1153;
    b.drawImage(images[0], 0, 0, 571, 1153, 0, 0, 571, 1153);
}
